import React, { Component } from "react";
import { connect } from 'react-redux';

class ProjectsCard extends Component {



    render() {
        return (
            <ul>

                {this.props.reduxStore.projectsReducer.map((projects,i) => {
                    return (
                        <ProjectList key={i} name={name} description={description} thumbnail={thumbnail}
                            website={website} date_completed={date_completed} tag_id={tag_id} />
                    );
                })}
                </ul>

        )
    }
}



const mapReduxStoreToProps = (reduxStore) => ({
    reduxStore
});
export default connect(mapReduxStoreToProps)(ProjectsCard);
